/**
 * @param {number[][]} grid
 * @return {number[]}
 */
var goodSubsetofBinaryMatrix = function(grid) {
    let m = grid.length, n = grid[0].length;
    let bestSubset = [];

    // Convert grid to bitmasks for efficient column sum calculation
    let bitmasks = new Array(m).fill(0);
    for (let i = 0; i < m; i++) {
        for (let j = 0; j < n; j++) {
            bitmasks[i] |= grid[i][j] << j;
        }
    }

    // Check all subsets
    for (let mask = 1; mask < (1 << m); mask++) {
        let subsetSum = new Array(n).fill(0);
        let subsetSize = 0;
        for (let i = 0; i < m; i++) {
            if ((mask & (1 << i)) !== 0) {
                subsetSize++;
                for (let j = 0; j < n; j++) {
                    if ((bitmasks[i] & (1 << j)) !== 0) {
                        subsetSum[j]++;
                    }
                }
            }
        }
        if (subsetSum.every(sum => sum <= Math.floor(subsetSize / 2))) {
            let currentSubset = [];
            for (let i = 0; i < m; i++) {
                if ((mask & (1 << i)) !== 0) {
                    currentSubset.push(i);
                }
            }
            if (currentSubset.length > bestSubset.length) {
                bestSubset = currentSubset;
            }
        }
    }

    return bestSubset;
};
